Defendant Erik Daniel Tejada in court with attorney Enku E Lin.  Defendant Erik Daniel Tejada in custody.  Benjamin A Wesson appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
AS TO COUNT 1:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of  7 YEARS, CONSECUTIVE to any other sentence with credit for 151 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 4 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 3 YEARS.

The defendant IS NOT eligible for the Challenge Incarceration Program or the Substance Abuse Program.

CONDITIONS OF EXTENDED SUPERVISION:
*Obtain AODA assessment and successfully complete follow-up treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No drug dealing or association with drug community (drug users/dealers or drug houses);
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victims Nicolas F., Aaron, R., Alexandre J.-S., Elizabeth L., Karissa H., Mitchell H. and co-actors Mary Molale, Willmarvin Diaz-Boria, Jeriel Rodriguez, and Abigail Baez;
*Obtain/maintain full time employment or full time school and part time employment;
*Participate in Anger Managment;
*Participate in Cognitive Thinking/Victim Program;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

State in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $75.00 payable to Aaron R.- to be paid first.  Restitution is joint and several with any co-actor ultimately convicted and sentenced in this matter (cases 14CF293-14CF296).  Restitution set at zero for all other victims.  Defendant to pay applicable mandatory surcharges, fees, assessments, and costs.  The Court ordered all financial obligations and restitution to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Defendant is informed he may not possess and/or own any firearms.  Defendant is informed he may not vote in any election until his civil rights have been reinstated.   Any amount remaining due and owing is subject to civil judgment.  Appeal rights given by the court.  
